import './App.css';
import HeaderBar from './components/HeaderBar'
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div id="app">
      <HeaderBar />
      <BrowserRouter>
        <Routes path="/" element={<Index />} />
      </BrowserRouter>
    </div>
  );
}

export default App;
